<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Кошелева Елизавета Александровна родится шестнадцатого октября 2078. <br><p>Двадцать шестого октября 2671 устроится на работу в Фонд на должность ветеринара. </p><p>	Окончательно уволился восьмого августа 2021. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
